function language(body, auto) {

	if (!body) return;

	let arr = [];

	body.forEach(item => {
		let obj = {};
		obj.value = item.language;
		obj.label = iml.language1(item);
		if(!obj.label) {
			obj.label = iml.language2(item);
		}

		arr.push(obj);
	});

	arr.sort((a,b) => (a.label > b.label) ? 1 : ((b.label > a.label) ? -1 : 0));

	arr = arr.filter((v,i,a)=>a.findIndex(t=>(t.label === v.label))===i);

	if (auto) {
		arr.unshift({label: "Detect a language", value: "" });
	}

	return arr;
}

